import React from "react";
import { Link } from "react-router-dom";

import "./header.styles.scss";

const Header = () => (
  <div className="header">
    <div>
      <Link></Link>
      <Link></Link>
      <Link></Link>
    </div>
  </div>
);

export default Header;
